import React, { useState } from 'react';

const CaseStudyCard = ({ 
  title, 
  company, 
  industry, 
  challenge, 
  solution, 
  results, 
  image,
  accentColor = 'primary'
}) => {
  const [isExpanded, setIsExpanded] = useState(false);

  const accentColors = {
    primary: 'border-primary-200/50 bg-gradient-to-br from-primary-50/50 to-primary-100/30',
    logistics: 'border-logistics-200/50 bg-gradient-to-br from-logistics-50/50 to-logistics-100/30',
    travel: 'border-travel-200/50 bg-gradient-to-br from-travel-50/50 to-travel-100/30'
  };

  const iconColors = {
    primary: 'text-primary-600',
    logistics: 'text-logistics-600',
    travel: 'text-travel-600'
  };

  return (
    <div className={`group relative rounded-3xl border border-white/40 shadow-elevated hover:shadow-floating transition-all duration-500 overflow-hidden hover:-translate-y-2 ${accentColors[accentColor]}`}>
      {/* Header */}
      <div className="p-8 pb-6">
        <div className="flex items-start justify-between mb-6">
          <div className="flex-1">
            <div className="flex items-center mb-3">
              <div className={`w-12 h-12 rounded-2xl bg-gradient-to-br from-${accentColor}-500 to-${accentColor}-600 flex items-center justify-center text-white text-xl font-bold mr-4 shadow-lg`}>
                {company.charAt(0)}
              </div>
              <div>
                <h3 className="text-xl font-bold text-gray-900">{company}</h3>
                <p className="text-sm text-gray-600">{industry}</p>
              </div>
            </div>
            <h2 className="text-2xl font-bold text-gray-900 mb-4">{title}</h2>
          </div>

          <button
            onClick={() => setIsExpanded(!isExpanded)}
            className={`p-2 rounded-lg transition-all duration-200 ${isExpanded ? 'bg-gray-100' : 'hover:bg-gray-50'}`}
          >
            <svg 
              className={`w-5 h-5 text-gray-600 transition-transform duration-200 ${isExpanded ? 'rotate-180' : ''}`}
              fill="none" 
              stroke="currentColor" 
              viewBox="0 0 24 24"
            >
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
            </svg>
          </button>
        </div>

        {/* Challenge Preview */}
        <div className="mb-6">
          <h4 className="text-lg font-semibold text-gray-900 mb-2 flex items-center">
            <span className={`w-2 h-2 rounded-full bg-${accentColor}-500 mr-3`}></span>
            Challenge
          </h4>
          <p className="text-gray-700 leading-relaxed">
            {challenge.length > 150 ? `${challenge.substring(0, 150)}...` : challenge}
          </p>
        </div>

        {/* Results Preview */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-6">
          {results.slice(0, 3).map((result, index) => (
            <div key={index} className="text-center p-4 bg-white/60 rounded-xl">
              <div className={`text-2xl font-bold ${iconColors[accentColor]} mb-1`}>
                {result.value}
              </div>
              <div className="text-sm text-gray-600">
                {result.label}
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Expanded Content */}
      {isExpanded && (
        <div className="px-8 pb-8 border-t border-white/40 pt-6">
          {/* Solution */}
          <div className="mb-6">
            <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center">
              <span className={`w-2 h-2 rounded-full bg-${accentColor}-500 mr-3`}></span>
              Our Solution
            </h4>
            <p className="text-gray-700 leading-relaxed">{solution}</p>
          </div>

          {/* Full Results */}
          <div className="mb-6">
            <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center">
              <span className={`w-2 h-2 rounded-full bg-${accentColor}-500 mr-3`}></span>
              Results Achieved
            </h4>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
              {results.map((result, index) => (
                <div key={index} className="text-center p-4 bg-white/60 rounded-xl">
                  <div className={`text-2xl font-bold ${iconColors[accentColor]} mb-1`}>
                    {result.value}
                  </div>
                  <div className="text-sm text-gray-600">
                    {result.label}
                  </div>
                </div>
              ))}
            </div>
          </div>

          {/* Call to Action */}
          <div className="text-center pt-4 border-t border-white/40">
            <button className={`px-6 py-3 bg-gradient-to-r from-${accentColor}-500 to-${accentColor}-600 text-white font-bold rounded-xl hover:from-${accentColor}-600 hover:to-${accentColor}-700 transition-all duration-300 shadow-lg hover:shadow-xl transform hover:-translate-y-1`}>
              Learn More About This Case
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default CaseStudyCard;
